#include <iostream> 
using namespace std; 

int main() 
{int n; cout<<"n="; cin>>n; 

double *a= new double [n]; //выделяем память под массивы переменных 
double *b= new double [n]; 
double *c= new double [n]; 
double *d= new double [n]; 

for (int i=0; i<n; i++) //вводим данные 
{if (i!=0) {cout<<"a["<<i<<"]="; cin>>a[i];}; 
cout<<"b["<<i<<"]="; cin>>b[i]; 
if (i!=n-1) {cout<<"c["<<i<<"]="; cin>>c[i];} 
cout<<"d["<<i<<"]="; cin>>d[i];} 

a[0]=0;// по условию метода прогонки эти множители =0 
c[n-1]=0; 

double *Q = new double [n]; //выделяем память под прогоночные коэффиценты 
double *P = new double [n]; 

P[0]=-c[0]/b[0]; //считаем прогоночные коэффиценты 
Q[0]=d[0]/b[0]; 

for (int i=1; i<n; i++)// проходимся по всей матрице 
{P[i]=-c[i]/(b[i]+a[i]*P[i-1]); 
Q[i]=(d[i]-a[i]*Q[i-1])/(b[i]+a[i]*P[i-1]);} 

double *x = new double [n];//выделяем память под решения иксы 

x[n-1]=Q[n-1]; // это соотношения тоже задается по условию 

for (int i=n-2; i>=0; i--) 
x[i]=P[i]*x[i+1]+Q[i];//формула по которой считают иксы 

cout<<endl; 

for (int i=0; i<n; i++)// вывод решения 
cout<<"x["<<i<<"]="<<x[i]<<endl; 

return 0; 
}

(function(){
  let $=n=>document.querySelector(n);
  let $$=n=>wrap(document.querySelectorAll(n))
  function first(n){
    let r=n[Symbol.iterator]().next();
    return "value" in r? r.value : Object.freeze({});
  }
  function wrap(n){
    return new Proxy(n,ldpd);
  }
  function mwrap(n,m){
    if (typeof m(first(n)) === "function"){
      return (...a) => mwrap(n,x=>m(x).apply(x,a));
    }
    return wrap(Array.prototype.map.call(n,m));
  }
  function getProp(n,p){
  	if (typeof first(n)[p] === "function"){
    	return (...a) => wrap(Array.prototype.map.call(n,x=>x[p](...a)));
    }
    return wrap(Array.prototype.map.call(n,x=>x[p]))
  }
  let ldpd = {
    has:(t,p) => p in t || p in first(t),
    set:(t,p,v) => p in t ? t[p]=v : Array.prototype.some.call(t,x=>x[p]=v),
    get:(t,p) => p in t ? t[p] : getProp(t,p),
    enumerate:(t) => t
  }
  window.$ = $;
  window.$$ = $$;
  window.$wrap = wrap;
})()

